import React from 'react';
import logo from './logo.svg';
import {BrowserRouter as Router, Route, Routes} from "react-router-dom"
import './App.css';
import Main from './components/Main';
import Navbar from './components/Navbar';

function App() {
  return (
    <Router>
        <Route path="/">
          <Main/>
        </Route>
        <Route path="/nav">
          <Navbar/>
        </Route>
    </Router>
  );
}

export default App;
